import react,{useEffect} from "react";
import './Patient.css';
import Card from "./Cards/Card"
import CoWithYou from "./CoWithYou Logo.png"
import { render } from "@testing-library/react";
import { useState } from 'react';
const Patient=()=>{
    const [data,setData]=useState([])
    var Data=[];
    const getData=async ()=>{
        console.log("GETDATA")
        try{
            const res=await fetch("/Patient",{
                method:"GET",
                headers:{
                    Accept:"application/json",
                    "Content-Type":"application/json"
                },
                credentials:"include"
            });
            setData(await res.json())
            if(!res.status===200){
                const err=new Error(res.error);
                throw err;
            }
        }catch(err){
            console.log(err)
        }
    }
    useEffect(() => {
        getData();
    })
    return(
        <>
        <div className="Container1" id="Container1">
        <div id="header1">
        <img className="Logo1"src={CoWithYou}></img>Namsthey SAVES your life... Shake hand SHAKES your life... 
        <img className="Logo2" src={CoWithYou}></img>

        {/* {document.write(data[0])} */}
        </div>
        <h1 id="intro">List of available Products..</h1>
        {
            Data.map((e)=>{
                while(e){
                render(
                    <div>
                    <Card Pname={e.Pname} PMD={e.PMD} PED={e.PED}Contact={e.Contact}PDescription={e.PDescription}/>
                    </div>
                )
                }
                  if(!e){
                    render(
                        <h1>Data not found</h1>
                    )
                }
            }) 
        }
        </div>
        </>
    )
}
export default Patient
